Female.
Similar to male (
Fig. 18
), except gena with 1 strong vibrissa; 4–6 variably lengthened subvibrissal setae. Terminalia as described in generic diagnosis; membrane between tergites and sternites 7 and 8 with large dark spines (
Fig. 24
).

Distribution.
This is a widespread, northern transcontinental species, ranging south along the western Cordillera (
Fig. 37
). This species is also found in the Palearctic Region (
Russia
) (Šifner 2008; 
Ozerov 2019
).
